import './App.css';

function App() {

  function handleValue(e){
    return e.target.value;
  }
  return (
    <div className="App">
     <input className="test" value="50" type="range" onInput={handleValue}/>
     <p>{handleValue()}</p>
    </div>
  );
}

export default App;
